import styled from 'styled-components';

export const StyledContent = styled.div`
    padding: 5px;
    display: flex;
    flex-direction: column;
    justify-content: center;
    @media (max-width: ${({ theme }) => theme.mobile}) {
        width: 100%;
    }
`;
